import { Grid } from "@mui/material";
import { Box } from "@mui/system";
import React from "react";

const contents = ["c","d","e"];

function Home(){

    return(
      <Grid container>
        <Grid item md={6} xs={10}>
            a
        </Grid>
        <Grid item md={6} xs={10}>
            b
        </Grid>
        {contents.map( (content , index) =>
        <Grid item xs={10} key={index}> content </Grid>
        )}
      </Grid>
    );

}

export default Home;
